import axios from 'axios';
import React, { Component } from 'react';

class Title extends Component {

  state = {
    users : []
  }

  setState(newUsers){
    users : newUsers
  }

  componentDidMount(){
    axios.get("https://jsonplaceholder.typicode.com/users")
    .then(
      function r(resp){
        let r = []
        r.push(resp.data)
        this.setState(r)
        console.log(r)
      }
    );
  }
  render(){
    return (
      <div>
          <h1>About our team : </h1>
          {this.state.users}
      </div>
    );
  }
}

export default Title;
